/*
In a deck of cards, each card has an integer written on it.

Return true if and only if you can choose X >= 2 such that it is possible to split the entire deck into 1 or more groups of cards, where:

    Each group has exactly X cards.
    All the cards in each group have the same integer.

Example 1:

Input: deck = [1,2,3,4,4,3,2,1]
Output: true
Explanation: Possible partition [1,1],[2,2],[3,3],[4,4].

Example 2:

Input: deck = [1,1,1,2,2,2,3,3]
Output: false´
Explanation: No possible partition.

Example 3:

Input: deck = [1]
Output: false
Explanation: No possible partition.

Example 4:

Input: deck = [1,1]
Output: true
Explanation: Possible partition [1,1].

Example 5:

Input: deck = [1,1,2,2,2,2]
Output: true
Explanation: Possible partition [1,1],[2,2],[2,2].  
*/

#include<iostream>
#include<unordered_map>
#include<vector>
#include<climits>

using namespace std;

class Solution {
public:
    bool hasGroupsSizeX(vector<int>& deck) {

        int partVal = INT_MAX;
        bool retVal = false;
        bool allDivisible = true;
        unordered_map<int, int> counts;

        // Put counts in to a hashmap
        for (int i = 0; i < deck.size(); ++i)
            counts[deck[i]]++;

        // Find minimum value in hashmap
        for (auto it = counts.begin(); it != counts.end(); it++) {
            if (it->second < partVal)
                partVal = it->second;
        }

        // Check that it is 2 or greater
        if (partVal < 2) 
            return false;

        // Check if two is a divisor
        for (auto it = counts.begin(); it != counts.end(); it++) {
            if ( (it->second % 2) != 0 ) {
                allDivisible = false;
                break;
            }
        }
        if ( allDivisible ) 
            return true;

        // Loop over odd prime factors of partVal
        for (int d = 3; d <= partVal; d += 2) {
            allDivisible = true;
            // Make sure it is a factor
            if ( (partVal % d) != 0) {
                continue;
            } 

            // See that it factors all counts
            for (auto it = counts.begin(); it != counts.end(); it++) {
                if ( (it->second % d) != 0 ) {
                    allDivisible = false;
                    break;
                }
            }
            // If all counts were divisible we are done
            if ( allDivisible ) 
                return true;
        }
        return false;
    }
};

